<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Our Services - Nail Studio</title>
    <link href="https://fonts.googleapis.com/css2?family=Great+Vibes&family=Cormorant+Garamond:wght@300;400;600&display=swap" rel="stylesheet">
    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        body {
            font-family: 'Cormorant Garamond', serif;
            background: linear-gradient(135deg, #ffeef8 0%, #ffe0f0 50%, #ffd9eb 100%);
            min-height: 100vh;
            padding: 40px 20px;
            position: relative;
            overflow-x: hidden;
        }

        body::before {
            content: '';
            position: fixed;
            top: 0;
            left: 0;
            right: 0;
            bottom: 0;
            background-image: 
                radial-gradient(ellipse at 20% 30%, rgba(255, 182, 193, 0.3) 0%, transparent 50%),
                radial-gradient(ellipse at 80% 70%, rgba(255, 192, 203, 0.25) 0%, transparent 50%),
                radial-gradient(ellipse at 50% 50%, rgba(255, 228, 225, 0.2) 0%, transparent 50%);
            pointer-events: none;
            z-index: 0;
        }

        .petal {
            position: fixed;
            width: 20px;
            height: 20px;
            background: radial-gradient(ellipse at center, rgba(255, 182, 193, 0.6), rgba(255, 192, 203, 0.3));
            border-radius: 50% 0 50% 0;
            opacity: 0.7;
            animation: float 15s infinite ease-in-out;
            z-index: 1;
        }

        .petal:nth-child(1) { top: 10%; left: 10%; animation-delay: 0s; }
        .petal:nth-child(2) { top: 20%; right: 15%; animation-delay: 2s; transform: rotate(45deg); }
        .petal:nth-child(3) { top: 60%; left: 5%; animation-delay: 4s; }
        .petal:nth-child(4) { top: 80%; right: 10%; animation-delay: 6s; transform: rotate(90deg); }
        .petal:nth-child(5) { top: 40%; right: 5%; animation-delay: 8s; }
        .petal:nth-child(6) { top: 70%; left: 20%; animation-delay: 10s; transform: rotate(135deg); }
        .petal:nth-child(7) { top: 30%; left: 30%; animation-delay: 12s; }
        .petal:nth-child(8) { top: 50%; right: 25%; animation-delay: 14s; transform: rotate(180deg); }

        @keyframes float {
            0%, 100% { transform: translateY(0) rotate(0deg); opacity: 0.7; }
            50% { transform: translateY(-20px) rotate(180deg); opacity: 0.4; }
        }

        .container {
            max-width: 1200px;
            margin: 0 auto;
            position: relative;
            z-index: 2;
        }

        h1 {
            font-family: 'Great Vibes', cursive;
            font-size: 80px;
            color: #d87093;
            text-align: center;
            margin-bottom: 60px;
            font-weight: 400;
            letter-spacing: 2px;
            text-shadow: 2px 2px 4px rgba(255, 182, 193, 0.3);
        }

        .services-grid {
            display: grid;
            grid-template-columns: repeat(3, 1fr);
            gap: 60px 40px;
            padding: 20px;
        }

        .service-item {
            text-align: center;
            cursor: pointer;
            transition: transform 0.3s ease;
        }

        .service-item:hover {
            transform: translateY(-10px);
        }

        .service-image-wrapper {
            width: 200px;
            height: 200px;
            margin: 0 auto 20px;
            border-radius: 50%;
            padding: 8px;
            background: linear-gradient(135deg, #ffb6c1, #ffc0cb, #ffb6c1);
            box-shadow: 0 8px 20px rgba(216, 112, 147, 0.3);
            transition: all 0.3s ease;
        }

        .service-item:hover .service-image-wrapper {
            box-shadow: 0 12px 30px rgba(216, 112, 147, 0.5);
            transform: scale(1.05);
        }

        .service-image {
            width: 100%;
            height: 100%;
            border-radius: 50%;
            object-fit: cover;
            background: #fff;
        }

        .service-name {
            font-family: 'Cormorant Garamond', serif;
            font-size: 28px;
            font-weight: 600;
            color: #8b4570;
            margin-bottom: 8px;
            text-transform: uppercase;
            letter-spacing: 2px;
        }

        .service-price {
            font-family: 'Cormorant Garamond', serif;
            font-size: 20px;
            color: #a0698f;
            font-weight: 300;
            font-style: italic;
        }

        .modal {
            display: none;
            position: fixed;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            background: rgba(0, 0, 0, 0.95);
            z-index: 1000;
            justify-content: center;
            align-items: center;
            animation: fadeIn 0.3s ease;
        }

        .modal.active {
            display: flex;
        }

        @keyframes fadeIn {
            from { opacity: 0; }
            to { opacity: 1; }
        }

        .modal-content {
            max-width: 90%;
            max-height: 90%;
            position: relative;
            animation: zoomIn 0.3s ease;
        }

        @keyframes zoomIn {
            from { transform: scale(0.8); opacity: 0; }
            to { transform: scale(1); opacity: 1; }
        }

        .modal-header {
            text-align: center;
            margin-bottom: 30px;
        }

        .modal-title {
            font-family: 'Great Vibes', cursive;
            font-size: 50px;
            color: #ffb6c1;
            margin-bottom: 10px;
        }

        .gallery-grid {
            display: grid;
            grid-template-columns: repeat(auto-fit, minmax(250px, 1fr));
            gap: 20px;
            padding: 20px;
            max-width: 1000px;
            max-height: 70vh;
            overflow-y: auto;
        }

        .gallery-grid::-webkit-scrollbar {
            width: 8px;
        }

        .gallery-grid::-webkit-scrollbar-track {
            background: rgba(255, 255, 255, 0.1);
            border-radius: 10px;
        }

        .gallery-grid::-webkit-scrollbar-thumb {
            background: #ffb6c1;
            border-radius: 10px;
        }

        .gallery-image {
            width: 100%;
            height: 300px;
            object-fit: cover;
            border-radius: 15px;
            border: 3px solid #ffb6c1;
            box-shadow: 0 8px 20px rgba(255, 182, 193, 0.4);
            transition: transform 0.3s ease;
        }

        .gallery-image:hover {
            transform: scale(1.05);
        }

        .close-btn {
            position: absolute;
            top: 20px;
            right: 40px;
            font-size: 50px;
            color: #ffb6c1;
            cursor: pointer;
            background: none;
            border: none;
            width: 60px;
            height: 60px;
            border-radius: 50%;
            display: flex;
            align-items: center;
            justify-content: center;
            transition: all 0.3s ease;
            font-weight: 300;
            line-height: 1;
        }

        .close-btn:hover {
            background: rgba(255, 182, 193, 0.2);
            transform: rotate(90deg);
        }

        .no-gallery-message {
            text-align: center;
            color: #ffb6c1;
            font-size: 24px;
            padding: 40px;
            font-style: italic;
        }

        @media (max-width: 768px) {
            h1 {
                font-size: 50px;
                margin-bottom: 40px;
            }

            .services-grid {
                grid-template-columns: repeat(2, 1fr);
                gap: 40px 30px;
            }

            .service-image-wrapper {
                width: 150px;
                height: 150px;
            }

            .service-name {
                font-size: 22px;
            }

            .service-price {
                font-size: 18px;
            }

            .gallery-grid {
                grid-template-columns: 1fr;
            }

            .modal-title {
                font-size: 40px;
            }
        }

        @media (max-width: 480px) {
            .services-grid {
                grid-template-columns: 1fr;
            }
        }
    </style>
</head>

        function openGallery(serviceId) {
            const gallery = galleries[serviceId];
            const modal = document.getElementById('galleryModal');
            const modalTitle = document.getElementById('modalTitle');
            const galleryGrid = document.getElementById('galleryGrid');

            modalTitle.textContent = gallery.name;
            galleryGrid.innerHTML = '';

            if (gallery.images.length === 0) {
                galleryGrid.innerHTML = '<div class="no-gallery-message">Gallery coming soon...</div>';
            } else {
                gallery.images.forEach(imagePath => {
                    const img = document.createElement('img');
                    img.src = imagePath;
                    img.alt = gallery.name;
                    img.className = 'gallery-image';
                    galleryGrid.appendChild(img);
                });
            }

            modal.classList.add('active');
            document.body.style.overflow = 'hidden';
        }

        function closeGallery() {
            const modal = document.getElementById('galleryModal');
            modal.classList.remove('active');
            document.body.style.overflow = 'auto';
        }

        document.getElementById('galleryModal').addEventListener('click', function(e) {
            if (e.target === this) {
                closeGallery();
            }
        });

        document.addEventListener('keydown', function(e) {
            if (e.key === 'Escape') {
                closeGallery();
            }
